import Node from './Node.js';
import _rotate_to from './_rotate_to.js';
import _rotate_right_modulo from './_rotate_right_modulo.js';

/**
 * Rotate list to the right n steps. The parameter n must be positive.
 *
 * @param {Node} x The current first node.
 * @param {Node} z The current last node.
 * @param {number} k MUST be positive.
 * @return {[Node, Node]} The new first and last nodes.
 */
export default function _rotate_right_unknown_length(x, z, k) {
	assert(Number.isInteger(k));
	assert(k > 0);
	assert(x instanceof Node);
	assert(x.prev === null);
	assert(z instanceof Node);
	assert(z.next === null);
	assert(x !== z);
	let y = x;
	let l = k;
	do {
		if (y === z) {
			return _rotate_right_modulo(x, z, k - l + 1, k);
		}

		y = y.next;
	} while (--l);

	const w = y.prev;
	_rotate_to(x, y, z);
	return [y, w];
}

import _split from './_split.js';
import _concat from './_concat.js';

export default function _rotate_to(x, y, z) {
	_split(y);
	_concat(z, x);
}

import assert from 'assert';
import Node from './Node.js';

/**
 * Removes first {@link Node} from a non-empty list.
 *
 * @param {Node} x First node (not null). Cannot be the last node.
 * @return {Node} New list (not null).
 */
export default function _shift(x) {
	assert(x instanceof Node);
	assert(x.prev === null);
	const next = x.next;
	assert(next !== null);
	next.prev = null;
	return next;
}

import assert from 'assert';
import Node from './Node.js';

/**
 * Split a list at {@link Node} x.
 *
 * /!\ The node to split at cannot be the first of the list.
 *
 * @param {Node} x Node to split at.
 */
export default function _split(x) {
	assert(x instanceof Node);
	assert(x.prev instanceof Node);
	x.prev.next = null;
	x.prev = null;
}

import assert from 'assert';
import Node from './Node.js';
import _concat from './_concat.js';

/**
 * Concatenate two input lists.
 *
 * @param {Node} x First node of first input list (can be null).
 * @param {Node} z Last node of first input list (can be null).
 * @param {Node} y First node of second input list (can be null).
 * @return {Node} First node of the output list (or null if empty).
 */
export default function concat(x, z, y) {
	if (x === null) {
		assert(z === null);
		return y;
	}

	assert(x instanceof Node);
	assert(z instanceof Node);
	if (y === null) return x;
	assert(y instanceof Node);
	_concat(z, y);
	return x;
}

/**
 * Return an empty list.
 *
 * @return {Node} The empty list.
 */
export default function empty() {
	return null;
}

import Node from './Node.js';
import _concat from './_concat.js';

/**
 * Creates a list from an input iterable.
 *
 * @param {Iterable} iterable The input iterable.
 * @return {Node} First node of the newly created list (or null if empty list).
 */
export default function from(iterable) {
	const it = iterable[Symbol.iterator]();
	const event = it.next();

	if (event.done) return null;

	const first = new Node(event.value);
	let last = first;

	for (const value of it) {
		const next = new Node(value);
		_concat(last, next);
		last = next;
	}

	return first;
}

